import React from 'react';

function Joke(props){
    return(
        <div>
            <h2 style={{display: props.question ? "block" : "none"}}>Qestion:{props.question}</h2>
            <h3>Answer:{props.punchLine}</h3>
            <hr/>
        </div>
        );
}

export default Joke;
